Perché sì, c’è chi ha scelto la strada più complicata per arrivare a me. Quella strada è irta di spine, lastricata dei trabocchetti di una mente birichina e infittita delle dietrologie di un cuore devoto a una forma di passione che con la carne ha poco a che vedere. Ma lasciate che vi spieghi come mai questi tre siano fra le mie persone preferite. Nonostante abbiano visto, e non solo intuito, che “il sonno della ragione genera mostri”, sognano che Dio li faccia “vivere come gli uccelli del cielo e i gigli dei campi”. Sanno bene che se pure la vita ha insegnato loro a non splendere e sono degli alunni modello (sì, a volte è meglio non capire la gente e neanche la vita, perché come dice Philiph Roth, “vivere è capirla male”), loro splenderanno, INVECE. E comunque vada splendono e splenderanno per me, “come diamanti in mezzo al cuore”. @feddinava ho almeno una foto con te in sospeso
@_luca_girardi_ non mi picchiare se ho ripescato quella foto insieme che non ti piace 
@pierfrank_zari non c’eri, ma come sempre nei miei pensieri sì ❤️ (così come @anaskhalil97 🥺)
